  To efficiently compute the n-th element of the Fibonacci number sequence using the recursive method, you can use the following approach:

def fibfib(n):
    if n == 0 or n == 1:
        return n
    else:
        return fibfib(n-1) + fibfib(n-2)

This approach uses memoization to store the results of previous computations, so that repeated calls to fibfib(n) with the same value of n can return the stored result directly instead of recomputing it.

In Python, you can use a dict to store the memoized results:

memo = {}
def fibfib(n):
    if n in memo:
        return memo[n]
    else:
        result = fibfib(n-1) + fibfib(n-2)
